package Model;

public class Teacher {

	String id;
	String pass;
	String depaid;

	
	public Teacher() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	public String getDepaid() {
		return depaid;
	}

	public void setDepaid(String depaid) {
		this.depaid = depaid;
	}

	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	
	public String getPass() {
		return pass;
	}

	public void setPass(String pass) {
		this.pass = pass;
	}

}
